import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { getPostDetails } from "../api/apiCalls";
import PostView from "../components/PostView";
import { useSelector } from "react-redux";
import Sidebar from "../components/Sidebar";
import Spinner from "../components/Spinner";
import { useTranslation } from "react-i18next";

const PostViewDetails = () => {
  const { postId } = useParams();
  const loggedInUser = useSelector((store) => store.username);
  const { t } = useTranslation();
  const [postDetails, setPostDetails] = useState();

  useEffect(() => {
    const getPost = async () => {
      try {
        const response = await getPostDetails(loggedInUser, postId);
        setPostDetails(response.data);
      } catch (error) {
        console.error("Error fetching post details:", error);
        setPostDetails(null);
      }
    };
    getPost();
  }, [postId]);

  if (!postDetails) {
    return (
      <div className="card my-2 text-center">
        <div class="alert alert-primary d-inline-block m-2" role="alert">
          <div>
            <Spinner />
          </div>
          <div className="ms-auto">{t("Loading...")}</div>
        </div>
      </div>
    );
  }

  return (
    <div className="container mt-3 pb-1">
      <div className="row">
        <div className="col-lg-2">
          <Sidebar />
        </div>
        <div className="col-lg-8 col-md-7 mb-3">
          <PostView post={postDetails} onDeletePost={() => {}} />
          <div className="card" style={{ borderRadius: "0px" }}>
            <div className="card-body">
              <textarea
                className="form-control"
                rows="4"
                placeholder="Write a comment..."
              />
              <button className="btn btn-post mt-2">Submit Comment</button>
            </div>
          </div>
        </div>
        <div className="col-lg-2 col-md-7 mb-3">
          {/* Trendler Sütunu */}
          <div className="card">
            <div className="card-header">{t("İlginizi Çekebilecek Trendler")}</div>
            <div class="  ">
  <div class="">
    <div class="list-group" id="list-tab" role="tablist">
      <a class="list-group-item list-group-item-action active" id="list-home-list" data-toggle="list" href="#list-home" role="tab" aria-controls="home">Home</a>
      <a class="list-group-item list-group-item-action" id="list-profile-list" data-toggle="list" href="#list-profile" role="tab" aria-controls="profile">Profile</a>
      <a class="list-group-item list-group-item-action" id="list-messages-list" data-toggle="list" href="#list-messages" role="tab" aria-controls="messages">Messages</a>
      <a class="list-group-item list-group-item-action" id="list-settings-list" data-toggle="list" href="#list-settings" role="tab" aria-controls="settings">Settings</a>
    </div>
  </div>
  <div class="">
    <div class="tab-content" id="nav-tabContent">
      <div class="tab-pane fade show active" id="list-home" role="tabpanel" aria-labelledby="list-home-list">...</div>
      <div class="tab-pane fade" id="list-profile" role="tabpanel" aria-labelledby="list-profile-list">...</div>
      <div class="tab-pane fade" id="list-messages" role="tabpanel" aria-labelledby="list-messages-list">...</div>
      <div class="tab-pane fade" id="list-settings" role="tabpanel" aria-labelledby="list-settings-list">...</div>
    </div>
  </div>
</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PostViewDetails;
